import React from 'react';
import './PdfContainer.css';
import { UncontrolledButtonDropdown, DropdownMenu, DropdownItem, DropdownToggle } from 'reactstrap';


export default (props) => {

  const bodyRef = React.createRef();
  const createPdf = () => props.createPdf(bodyRef.current);
  const sravan=()=> window.open("https://update-portfolio.herokuapp.com/portfolio.html");



  return (
    <section className="pdf-container">
      <section className="pdf-toolbar">
        <button onClick={createPdf}>Resume Download</button>
        <button  onClick={sravan}>Portfolio</button>

        <button>Website</button>
        <UncontrolledButtonDropdown>
      <DropdownToggle caret>
        Dropdown
      </DropdownToggle>
      <DropdownMenu>
      <DropdownItem href="https://governor-website.invisionapp.com/overview/DMV-cjzokhwe211t1018r4deje5ut/screens?v=wagw9IU8eniHzoMlTKfoVg%3D%3D&linkshare=urlcopied">Action</DropdownItem>
    <DropdownItem href="#/action-2">Another action</DropdownItem>
    <DropdownItem href="#/action-3">Something else</DropdownItem>
      </DropdownMenu>
    </UncontrolledButtonDropdown>
      </section>
      <section className="pdf-body" ref={bodyRef}>
        {props.children}
      </section>
    </section>
  )
  }
